import Mailinfo from "./mailInfo";
const Homepage = () => {
    const data = [{
        id:1,
        body: 'MEEt vahaeoihf'
    },
    {
        id:2,
        body: 'MEEt 2 vahaeoihf'
    }] ;
   
    return (
        <div>
            {data.map((obj)=>{
            <Mailinfo id={obj.id} body={obj.body}></Mailinfo>
        })}
        </div>
        
    )

} ;

export default Homepage ;
